import React, { useState, useEffect } from 'react';

function Teams() {
  const [data, setData] = useState({ hits: [] });
  useEffect(async () => {
    const result = await fetch(
      'data.json',
    );
    setData(result);
  });
  return (
    <ul>
      data
    </ul>
  );
}

export default Teams
